        FFT.W = [pow(g, FFT.MOD - 1 >> i, FFT.MOD) for i in range(30)]
        FFT.iW = [pow(ig, FFT.MOD - 1 >> i, FFT.MOD) for i in range(30)]

    def primitive_root_constexpr(self):
